import React from 'react';

const Actions = () => {
  return (
    <div>
      <h1>Take Action</h1>
      <p>Explore ways you can help protect endangered species. Participate in conservation campaigns, volunteer, or spread awareness.</p>
      <ul>
        <li>Adopt an animal</li>
        <li>Donate to conservation projects</li>
        <li>Participate in clean-up drives</li>
        <li>Spread awareness on social media</li>
      </ul>
    </div>
  );
};

export default Actions;
